import React, { FC } from 'react';

import './style.css';

interface IProps {
  questionName: string;
  questionQuest: string;
  isTrue: boolean;
  name: string;
}

const AnswersContainer: FC<IProps> = (props) => {
  const { questionName, questionQuest, isTrue, name } = props;
  return (
    <div>
      <nav>
        <h1>Что-то для CIB</h1>
      </nav>
      <div className="bod">
        <div className="inputBox">
          <div className='leftObject'>
            <h1>{questionName}</h1>
            <h2>{questionQuest}</h2>
            <label>
              <input type="radio" />
              <h4>{name}</h4>
            </label>
            <label>
              <input type="radio" />
              <h4>{name}</h4>
            </label>
            <label>
              <input type="radio" />
              <h4>{name}</h4>
            </label>
            <label>
              <input type="radio" /> <h4>{name}</h4>
            </label>
            <button></button>
          </div>
          <img src="" alt="Image" className="rightImage" />

        </div>
      </div>
    </div>
  );
};

export default AnswersContainer;
